function getSelectedCheckboxes(){const e=document.querySelectorAll('input[type="checkbox"]:checked');let t=[];return e.forEach(function(e){t.push(e.value)}),t}function compareClick(){const e=getSelectedCheckboxes();2===e.length?window.location.href="/comparing.htm#"+e.join("/"):modalAlert("You must select two diagrams to compare.")}function disableUncheckedBoxes(){const e=document.querySelectorAll('input[type="checkbox"]:not(:checked):not(:disabled)');e.forEach(function(e){e.disabled=!0,e.parentElement.classList.add("disabled")})}function enableUncheckedBoxes(){const e=document.querySelectorAll('input[type="checkbox"]:not(:checked):disabled');e.forEach(function(e){e.disabled=!1,e.parentElement.classList.remove("disabled")})}function checkboxChanged(){const e=getSelectedCheckboxes();2===e.length?disableUncheckedBoxes():enableUncheckedBoxes()}function addDiagram(e,t,n){const c=document.createElement("input");c.type="checkbox",c.value="*"+t;const o=document.createElement("label");o.appendChild(c),o.append(n.Title),e.appendChild(o)}function addSavedDiagrams(){const e=document.getElementById("saved-diagrams");let t=[];for(let e=0;e<localStorage.length;e+=1){const n=localStorage.key(e);n!==StoreName.Flags&&n!==StoreName.Settings&&t.push(n)}if(0===t.length)e.append("There are no saved diagrams.");else{t=t.sort(function(e,t){return parseInt(e)-parseInt(t)});for(const n of t){const t=localStorage.getItem(n);if(t){const c=JSON.parse(t);c&&addDiagram(e,n,c)}}}}function setupCheckboxes(){const e=document.querySelectorAll('input[type="checkbox"]');e.forEach(function(e){e.addEventListener("change",checkboxChanged)})}function DOMContentLoaded(){isEmbedded()&&(document.getElementById("menu").style.display="none"),setupOfflineIndicator(),setupModal(),addSavedDiagrams(),setupCheckboxes(),document.getElementById("button-compare").addEventListener("click",compareClick)}document.addEventListener("DOMContentLoaded",DOMContentLoaded);